(244, 1, '2023-07-28 13:11:01', '2023-07-28 13:11:01', '<!-- wp:paragraph -->\n<p>Coffee traces its origin to a genus of plants known as&nbsp;<em>Coffea</em>.&nbsp; Within the genus there are over 500 genera and 6,000 species of tropical trees and shrubs. Experts estimate that there are anywhere from 25 to 100 species of coffee plants.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The genus was first described in the 18th century by the Swedish botanist, Carolus Linneaus, who also described Coffea Arabica in his Species Plantarum in 1753. Botanists have disagreed ever since on the exact classification, since coffee plants can range widely. They can be small shrubs to tall trees, with leaves from one to 16 inches in size, and in colors from purple or yellow to the predominant dark green.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In the commercial coffee industry, there are two important coffee species — Arabica and Robusta.</p>\n<!-- /wp:paragraph -->', 'Botanical classification', 'Coffee traces its origin to a genus of plants known as Coffea. ', 'inherit', 'closed', 'closed', '', '242-revision-v1', '', '', '2023-07-28 13:11:01', '2023-07-28 13:11:01', '', 242, 'http://localhost/e-commerce/?p=244', 0, 'revision', '', 0),
(245, 1, '2023-07-28 13:16:35', '2023-07-28 13:16:35', '<!-- wp:paragraph -->\n<p><em>Varieties: Bourbon, Typica, Caturra, Mundo Novo, Tico, San Ramon, Jamaican Blue Mountain</em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><em>Coffea Arabica</em>&nbsp;is descended from the original coffee trees discovered in Ethiopia.&nbsp; These trees produce a fine, mild, aromatic coffee and represent approximately 70% of the world\'s coffee production. The beans are flatter and more elongated than Robusta and lower in caffeine.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>On the world market, Arabica coffees bring the highest prices.&nbsp; The better Arabicas are high grown coffees — generally grown between 2,000 to 6,000 feet (610 to 1830 meters) above sea level — though optimal altitude varies with proximity to the equator.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The most important factor is that temperatures must remain mild, ideally between 59 - 75 degrees Fahrenheit, with about 60 inches of rainfall a year. The trees are hearty, but a heavy frost will kill them. &nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Arabica trees are costly to cultivate because the ideal terrain tends to be steep and access is difficult. Also, because the trees are more disease-prone than Robusta, they require additional care and attention.&nbsp;</p>\n<!-- /wp:paragraph -->', 'Coffea Arabica — C. Arabica ', 'Coffea Arabica is descended from the original coffee trees discovered in Ethiopia. ', 'publish', 'open', 'open', '', 'coffea-arabica-c-arabica', '', '', '2023-07-28 13:41:31', '2023-07-28 13:41:31', '', 0, 'http://localhost/e-commerce/?p=245', 0, 'post', '', 0),
