(249, 1, '2023-07-28 13:36:00', '2023-07-28 13:36:00', '<!-- wp:paragraph -->\n<p>Everyone recognizes a roasted coffee bean, but you might not recognize an actual coffee plant.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Coffee trees are pruned short to conserve their energy and aid in harvesting, but can grow to more than 30 feet (9 meters) high. Each tree is covered with green, waxy leaves growing opposite each other in pairs. Coffee cherries grow along the branches. Because it grows in a continuous cycle, it’s not unusual to see flowers, green fruit and ripe fruit simultaneously on a single tree.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>It takes nearly a year for a cherry to mature after first flowering, and about 5 years of growth to reach full fruit production. While coffee plants can live up to 100 years, they are generally the most productive between the ages of 7 and 20. Proper care can maintain and even increase their output over the years, depending on the variety. The average coffee tree produces 10 pounds of coffee cherry per year, or 2 pounds of green beans.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>All commercially grown coffee is from a region of the world called&nbsp;<a href=\"https://www.ncausa.org/About-Coffee/Coffee-Around-the-World\">the Coffee Belt</a>. The trees grow best in rich soil, with mild temperatures, frequent rain and shaded sun.</p>\n<!-- /wp:paragraph -->', 'What is Coffee?', 'Everyone recognizes a roasted coffee bean, but you might not recognize an actual coffee plant.', 'inherit', 'closed', 'closed', '', '248-revision-v1', '', '', '2023-07-28 13:36:00', '2023-07-28 13:36:00', '', 248, 'http://localhost/e-commerce/?p=249', 0, 'revision', '', 0),
(250, 1, '2023-07-28 13:53:18', '2023-07-28 13:53:18', '<!-- wp:paragraph -->\n<p><em>Variety: Robusta</em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Most of the world\'s Robusta is grown in Central and Western Africa, parts of Southeast Asia, including Indonesia and Vietnam, and in Brazil. Production of Robusta is increasing, though it accounts for only about 30% of the world market.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Robusta is primarily used in blends and for instant coffees. The Robusta bean itself tends to be slightly rounder and smaller than an Arabica bean. &nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The Robusta tree is heartier and more resistant to disease and parasites, which makes it easier and cheaper to cultivate. It also has the advantage of being able to withstand warmer climates, preferring constant temperatures between 75 and 85 degrees Fahrenheit, which enables it to grow at far lower altitudes than Arabica. &nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>It requires about 60 inches of rainfall a year, and cannot withstand frost. Compared with Arabica, Robusta beans produce a coffee which has a distinctive taste and about 50-60% more caffeine. &nbsp;</p>\n<!-- /wp:paragraph -->', 'Coffea canephora — C. canephora var. Robusta', 'Robusta is primarily used in blends and for instant coffees. ', 'publish', 'open', 'open', '', 'coffea-canephora-c-canephora-var-robusta', '', '', '2023-07-28 13:53:21', '2023-07-28 13:53:21', '', 0, 'http://localhost/e-commerce/?p=250', 0, 'post', '', 0),
