(253, 1, '2023-07-28 14:22:32', '2023-07-28 14:22:32', '<!-- wp:paragraph -->\n<p>Espresso is a concentrated form of coffee, served in shots, and is often the coffee base of many other types of coffee drinks, such as cappuccino, latte, americano and macchiato.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>But what is an espresso? Espresso is not a type of coffee bean or a roasting style – a common misconception. It’s a process of brewing coffee and is instead made by forcing high-pressured hot water through very finely ground coffee beans. This is then topped with a crema, a brown foam, that adds the rich, full-flavoured aftertaste. An espresso is intense and bold, but nonetheless delicious, and is usually served in small demitasse-style cups for this reason.</p>\n<!-- /wp:paragraph -->', 'Espresso', '', 'publish', 'open', 'open', '', 'espresso', '', '', '2023-07-28 14:27:09', '2023-07-28 14:27:09', '', 0, 'http://localhost/e-commerce/?p=253', 0, 'post', '', 0),
