(255, 1, '2023-07-28 14:22:32', '2023-07-28 14:22:32', '<!-- wp:paragraph -->\n<p>The espresso, also known as a short black, is approximately 1 oz. of highly concentrated coffee. Although simple in appearance, it can be difficult to master.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li><strong>Ratio:</strong>&nbsp;1 shot of espresso</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li><strong>Cup:</strong>&nbsp;<strong><a href=\"https://www.webstaurantstore.com/42693/espresso-cups.html?filter=capacity:2~4*-oz.\" target=\"_blank\" rel=\"noreferrer noopener\">2-4 oz. Espresso Cup</a></strong></li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->', 'Espresso', '', 'inherit', 'closed', 'closed', '', '253-revision-v1', '', '', '2023-07-28 14:22:32', '2023-07-28 14:22:32', '', 253, 'http://localhost/e-commerce/?p=255', 0, 'revision', '', 0),
