(257, 1, '2023-07-28 14:24:38', '2023-07-28 14:24:38', '<!-- wp:paragraph -->\n<p>A cappuccino is the perfect balance of&nbsp;<a href=\"https://www.nescafe.com/in/coffee-types/what-is-an-espresso\">espresso</a>, steamed milk and foam. This coffee is all about the structure and the even splitting of all elements into equal thirds. An expertly made cappuccino should be rich, but not acidic and have a mildly sweet flavouring from the milk. And, because the milk is not actually mixed in it gives the espresso a stronger flavour.</p>\n<!-- /wp:paragraph -->', 'Cappuccino', 'This creamy coffee drink is usually consumed at breakfast time in Italy and is loved in the United States as well.', 'publish', 'open', 'open', '', 'cappuccino', '', '', '2023-07-28 14:26:09', '2023-07-28 14:26:09', '', 0, 'http://localhost/e-commerce/?p=257', 0, 'post', '', 0),
(258, 1, '2023-07-28 14:24:07', '2023-07-28 14:24:07', '', 'coffee-drinks_cappuccino', '', 'inherit', 'open', 'closed', '', 'coffee-drinks_cappuccino', '', '', '2023-07-28 14:24:07', '2023-07-28 14:24:07', '', 257, 'http://localhost/e-commerce/wp-content/uploads/2023/07/coffee-drinks_cappuccino.webp', 0, 'attachment', 'image/webp', 0),
(259, 1, '2023-07-28 14:24:38', '2023-07-28 14:24:38', '<!-- wp:paragraph -->\n<p>This creamy coffee drink is usually consumed at breakfast time in Italy and is loved in the United States as well. It is usually associated with indulgence and comfort because of its thick foam layer and additional flavorings that can be added to it.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li><strong>Ratio:</strong>&nbsp;1-2 shots of espresso + 2 oz. of steamed milk + 2 oz. of foamed milk + sprinkling of chocolate powder (optional)</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li><strong>Cup:</strong>&nbsp;<strong><a href=\"https://www.webstaurantstore.com/search/cappuccino-cup.html\" target=\"_blank\" rel=\"noreferrer noopener\">6-8 oz. Cappuccino Mug</a></strong></li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->', 'Cappuccino', 'This creamy coffee drink is usually consumed at breakfast time in Italy and is loved in the United States as well.', 'inherit', 'closed', 'closed', '', '257-revision-v1', '', '', '2023-07-28 14:24:38', '2023-07-28 14:24:38', '', 257, 'http://localhost/e-commerce/?p=259', 0, 'revision', '', 0),
(260, 1, '2023-07-28 14:26:07', '2023-07-28 14:26:07', '<!-- wp:paragraph -->\n<p>A cappuccino is the perfect balance of&nbsp;<a href=\"https://www.nescafe.com/in/coffee-types/what-is-an-espresso\">espresso</a>, steamed milk and foam. This coffee is all about the structure and the even splitting of all elements into equal thirds. An expertly made cappuccino should be rich, but not acidic and have a mildly sweet flavouring from the milk. And, because the milk is not actually mixed in it gives the espresso a stronger flavour.</p>\n<!-- /wp:paragraph -->', 'Cappuccino', 'This creamy coffee drink is usually consumed at breakfast time in Italy and is loved in the United States as well.', 'inherit', 'closed', 'closed', '', '257-revision-v1', '', '', '2023-07-28 14:26:07', '2023-07-28 14:26:07', '', 257, 'http://localhost/e-commerce/?p=260', 0, 'revision', '', 0),
(261, 1, '2023-07-28 14:27:07', '2023-07-28 14:27:07', '<!-- wp:paragraph -->\n<p>Espresso is a concentrated form of coffee, served in shots, and is often the coffee base of many other types of coffee drinks, such as cappuccino, latte, americano and macchiato.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>But what is an espresso? Espresso is not a type of coffee bean or a roasting style – a common misconception. It’s a process of brewing coffee and is instead made by forcing high-pressured hot water through very finely ground coffee beans. This is then topped with a crema, a brown foam, that adds the rich, full-flavoured aftertaste. An espresso is intense and bold, but nonetheless delicious, and is usually served in small demitasse-style cups for this reason.</p>\n<!-- /wp:paragraph -->', 'Espresso', '', 'inherit', 'closed', 'closed', '', '253-revision-v1', '', '', '2023-07-28 14:27:07', '2023-07-28 14:27:07', '', 253, 'http://localhost/e-commerce/?p=261', 0, 'revision', '', 0),
