(49, 'ipp_refresh_q2_2023_us_inbox_notification', 'marketing', 'en_US', 'Grow on the go with in-person payments', 'Sell your products or services on the go with the M2 card reader – a quick, synchronized, and secure way to take payments, no matter where you are. Create an order using the WooCommerce mobile app and connect your card reader to accept payments.', '{}', 'pending', 'woocommerce.com', '2023-07-11 11:47:25', NULL, 0, 'plain', '', 0, 0, 'info'),
(50, 'ipp_refresh_q2_2023_ca_inbox_notification', 'marketing', 'en_US', 'Grow on the go with in-person payments', 'Sell your products or services on the go with the WisePad 3 card reader – a quick, synchronized, and secure way to take payments, no matter where you are. Create an order using the WooCommerce mobile app and connect your card reader to accept payments.', '{}', 'pending', 'woocommerce.com', '2023-07-11 11:47:25', NULL, 0, 'plain', '', 0, 0, 'info'),
(51, 'woocommerce-WCstripe-May-2023-updated-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce Stripe plugin', '<strong>Your store requires a security update for the WooCommerce Stripe plugin</strong>. Please update the WooCommerce Stripe plugin immediately to address a potential vulnerability.', '{}', 'pending', 'woocommerce.com', '2023-07-11 11:47:25', NULL, 0, 'plain', '', 0, 0, 'info'),
(52, 'woocommerce-WCPayments-June-2023-updated-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce Payments', '<strong>Your store requires a security update for the WooCommerce Payments plugin</strong>. Please update the WooCommerce Payments plugin immediately to address a potential vulnerability.', '{}', 'pending', 'woocommerce.com', '2023-07-11 11:47:25', NULL, 0, 'plain', '', 0, 0, 'info'),
(53, 'woocommerce-WCSubscriptions-June-2023-updated-needed', 'marketing', 'en_US', 'Action required: Security update of WooCommerce Subscriptions', '<strong>Your store requires a security update for the WooCommerce Subscriptions plugin</strong>. Please update the WooCommerce Subscriptions plugin immediately to address a potential vulnerability.', '{}', 'pending', 'woocommerce.com', '2023-07-11 11:47:25', NULL, 0, 'plain', '', 0, 0, 'info'),
(54, 'woocommerce-WCReturnsWarranty-June-2023-updated-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce Returns and Warranty Requests extension', '<strong>Your store requires a security update for the Returns and Warranty Requests extension</strong>.  Please update to the latest version of the WooCommerce Returns and Warranty Requests extension immediately to address a potential vulnerability discovered on May 31.', '{}', 'pending', 'woocommerce.com', '2023-07-11 11:47:26', NULL, 0, 'plain', '', 0, 0, 'info'),
(55, 'woocommerce_hpos_1st_notification_q2_2023', 'marketing', 'en_US', 'High-Performance Order Storage (HPOS) is on its way', 'Our team is targeting August 2023 to roll out a major database upgrade that can unlock faster checkout and order creation for your customers — and lightning-quick order lookup for you. Enablement is optional and you won’t be forced to update, but read on to see why this was our most requested new feature.', '{}', 'unactioned', 'woocommerce.com', '2023-07-11 11:47:27', NULL, 0, 'plain', '', 0, 1, 'info'),
(56, 'woocommerce-WCOPC-June-2023-updated-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce One Page Checkout', '<strong>Your shop requires a security update to address a vulnerability in the WooCommerce One Page Checkout extension</strong>. The fix for this vulnerability was released for this extension on June 13th. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-07-11 11:47:27', NULL, 0, 'plain', '', 0, 0, 'info'),
(57, 'woocommerce-WCGC-July-2023-update-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce GoCardless Extension', '<strong>Your shop requires a security update to address a vulnerability in the WooCommerce GoCardless extension</strong>. The fix for this vulnerability was released on July 4th. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-07-11 11:47:27', NULL, 0, 'plain', '', 0, 0, 'info'),
(58, 'wc-admin-wcpay-bulgaria-Q2-2023', 'marketing', 'en_US', 'WooCommerce Payments is now available in Bulgaria!', 'We’ve recently released WooCommerce Payments in Bulgaria. You can view and manage transactions right in your WordPress dashboard while securely accepting major cards, Apple Pay, and payments in over 100 currencies.', '{}', 'pending', 'woocommerce.com', '2023-07-11 11:47:27', NULL, 0, 'plain', '', 0, 0, 'info'),
