(64, 'woocommerce-shipping-fedex-api-outage-2023-07-16', 'warning', 'en_US', 'Scheduled FedEx API outage — July 2023', 'On July 16 there will be a full outage of the FedEx API from 04:00 to 08:00 AM UTC. Due to planned maintenance by FedEx, you\'ll be unable to provide FedEx shipping rates during this time. Follow the link below for more information and recommendations on how to minimize impact.', '{}', 'pending', 'woocommerce.com', '2023-07-11 11:47:29', NULL, 0, 'plain', '', 0, 0, 'info'),
(65, 'wc-refund-returns-page', 'info', 'en_US', 'Setup a Refund and Returns Policy page to boost your store\'s credibility.', 'We have created a sample draft Refund and Returns Policy page for you. Please have a look and update it to fit your store.', '{}', 'unactioned', 'woocommerce-core', '2023-07-11 11:48:12', NULL, 0, 'plain', '', 0, 1, 'info'),
(66, 'storefront-customize', 'info', 'en_US', 'Design your store with Storefront 🎨', 'Visit the Storefront settings page to start setup and customization of your shop.', '{}', 'unactioned', 'storefront', '2023-07-11 12:26:39', NULL, 0, 'plain', '', 0, 1, 'info'),
(67, 'wc-admin-choosing-a-theme', 'marketing', 'en_US', 'Choosing a theme?', 'Check out the themes that are compatible with WooCommerce and choose one aligned with your brand and business needs.', '{}', 'unactioned', 'woocommerce-admin', '2023-07-15 05:30:03', NULL, 0, 'plain', '', 0, 0, 'info'),
(68, 'wc-admin-customizing-product-catalog', 'info', 'en_US', 'How to customize your product catalog', 'You want your product catalog and images to look great and align with your brand. This guide will give you all the tips you need to get your products looking great in your store.', '{}', 'unactioned', 'woocommerce-admin', '2023-07-15 05:30:03', NULL, 0, 'plain', '', 0, 0, 'info'),
(69, 'wc-admin-launch-checklist', 'info', 'en_US', 'Ready to launch your store?', 'To make sure you never get that sinking \"what did I forget\" feeling, we\'ve put together the essential pre-launch checklist.', '{}', 'unactioned', 'woocommerce-admin', '2023-07-15 05:30:04', NULL, 0, 'plain', '', 0, 0, 'info'),
(70, 'wc-admin-mobile-app', 'info', 'en_US', 'Install Woo mobile app', 'Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics — wherever you are.', '{}', 'unactioned', 'woocommerce-admin', '2023-07-15 05:30:05', NULL, 0, 'plain', '', 0, 0, 'info'),
(71, 'wcship-2023-07-hazmat-update-needed', 'update', 'en_US', 'Action required: USPS HAZMAT compliance update for WooCommerce Shipping & Tax extension', '<strong>Your store requires an update for the WooCommerce Shipping extension</strong>. Please update to the latest version of the WooCommerce Shipping &amp; Tax extension immediately to ensure compliance with new USPS HAZMAT rules currently in effect.', '{}', 'pending', 'woocommerce.com', '2023-07-15 05:30:21', NULL, 0, 'plain', '', 0, 0, 'info'),
(72, 'square_payments_q3_2023', 'marketing', 'en_US', 'Square for WooCommerce', 'Connect your Square account with WooCommerce to accept online and in-person payments (including contactless payments and cross-channel gift cards) quickly and securely. Save time by syncing sales, customers, and items and inventory — and manage everything through one centralized platform.', '{}', 'pending', 'woocommerce.com', '2023-07-23 05:29:05', NULL, 0, 'plain', '', 0, 0, 'info'),
(73, 'wc-admin-woopayments-rebrand', 'marketing', 'en_US', 'WooCommerce Payments is now WooPayments', 'We’ve changed the name as part of recent updates to the Woo brand. You’ll still enjoy the same seamless payments experience — just look for WooPayments in your WordPress admin.', '{}', 'pending', 'woocommerce.com', '2023-07-29 11:48:00', NULL, 0, 'plain', '', 0, 0, 'info'),
(74, 'woocommerce-WCStripe-Aug-2023-update-needed', 'update', 'en_US', 'Action required: Security update for WooCommerce Stripe plugin', '<strong>Your shop requires an important security update for the  WooCommerce Stripe plugin</strong>. The fix for this vulnerability was released on July 31. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-08-03 14:13:40', NULL, 0, 'plain', '', 0, 0, 'info'),
(75, 'woocommerce-WCStripe-Aug-2023-security-updated', 'update', 'en_US', 'Security update of WooCommerce Stripe plugin', '<strong>Your store has been updated to the latest secure version of the WooCommerce Stripe plugin</strong>. This update was released on July 31.', '{}', 'pending', 'woocommerce.com', '2023-08-03 14:13:40', NULL, 0, 'plain', '', 0, 0, 'info'),
(76, 'woocommerce-WooPayments-Aug-2023-update-needed', 'update', 'en_US', 'Action required: Security update for WooPayments (WooCommerce Payments) plugin', '<strong>Your shop requires an important security update for the WooPayments (WooCommerce Payments) extension</strong>. The fix for this vulnerability was released on July 31. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-08-03 14:13:40', NULL, 0, 'plain', '', 0, 0, 'info'),
(77, 'woocommerce-WooPayments-Aug-2023-security-updated', 'update', 'en_US', 'Security update of WooPayments (WooCommerce Payments) plugin', '<strong>Your store has been updated to the more secure version of WooPayments (WooCommerce Payments)</strong>. This update was released on July 31.', '{}', 'pending', 'woocommerce.com', '2023-08-03 14:13:40', NULL, 0, 'plain', '', 0, 0, 'info');
